script: |
  super -f text -I q512.spq | sort > q512.out

inputs:
  - name: q512.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN + - 93 AND - - col0 / col1 - + col0 + + 60 * col1 * + col0 * - col1 + - col1;
  - name: tab0

outputs:
  - name: q512.out
    data: |
      15	81	47
      87	21	10
      97	1	99
